=head1 DESCRIPTION

Shows the duration, the date and time that the contract started and
ends, and the renewal status of the commitment period for the radio
unit.

=head1 ATTRIBUTES


=head2 B<REQUIRED> CommitmentConfiguration => L<Paws::PrivateNetworks::CommitmentConfiguration>

The duration and renewal status of the commitment period for the radio
unit.


=head2 ExpiresOn => Str

The date and time that the commitment period ends. If you do not cancel
or renew the commitment before the expiration date, you will be billed
at the 60-day-commitment rate.


=head2 StartAt => Str

The date and time that the commitment period started.



